import axios from "axios";

const BACKEND_URL =
  "https://react-native-http-de5e5-default-rtdb.asia-southeast1.firebasedatabase.app";
export function storeExpense(expenseData) {
  axios.post(BACKEND_URL + "/expenses.json", expenseData);
}

export function fetchExpenses() {
  axios.get(
    "https://react-native-http-de5e5-default-rtdb.asia-southeast1.firebasedatabase.app/expenses.json"
  );
}
